from collections import defaultdict

class Solution:
    #   Time Limit Exceeded
    def possibleBipartition0(self, N, dislikes):
        edgeDict = defaultdict(set)
        for a, b in dislikes:
            edgeDict[a].add(b)
            edgeDict[b].add(a)
        for n, neighbors in edgeDict.items():
            evenSet, oddSet, q = set([n]), set(), [(1, neighbor) for neighbor in list(neighbors)]
            while q:
                d, node = q.pop(0)
                if 0 == d % 2:
                    if node in oddSet:
                        return False
                    evenSet.add(node)
                else:
                    if node in evenSet:
                        return False
                    oddSet.add(node)
                for nextNeighbor in list(edgeDict[node]):
                    if nextNeighbor in evenSet or nextNeighbor in oddSet:
                        continue
                    q.append((d + 1, nextNeighbor))
        return True

    #   Time Limit Exceeded
    def possibleBipartition1(self, N, dislikes):
        edgeDict = defaultdict(list)
        for a, b in dislikes:
            edgeDict[a].append(b)
            edgeDict[b].append(a)
        visitedSet = set()
        for n, neighbors in edgeDict.items():
            if n in visitedSet:
                continue
            evenSet, oddSet, q = set([n]), set(), [(1, neighbor) for neighbor in neighbors]
            while q:
                d, node = q.pop(0)
                if 0 == d % 2:
                    if node in oddSet:
                        return False
                    evenSet.add(node)
                else:
                    if node in evenSet:
                        return False
                    oddSet.add(node)
                for nextNeighbor in edgeDict[node]:
                    if nextNeighbor in evenSet or nextNeighbor in oddSet:
                        continue
                    q.append((d + 1, nextNeighbor))
            visitedSet = visitedSet.union(evenSet).union(oddSet)
        return True

    #   runtime; 136ms, 85.00%
    #   memory; 15.1MB, 35.90%
    def possibleBipartition(self, N, dislikes):
        if dislikes is None or 0 == len(dislikes):
            return True
        edgeDict = defaultdict(list)
        for a, b in dislikes:
            edgeDict[a].append(b)
            edgeDict[b].append(a)
        group1, group2 = set(), set()
        for a, b in dislikes:
            if a in group1 or a in group2:
                continue
            q = [(True, a)]
            while q:
                isGroup1, n = q.pop(0)
                if n in group1 and n in group2:
                    return False
                if isGroup1:
                    group1.add(n)
                    for neighbor in edgeDict[n]:
                        if neighbor in group2:
                            continue
                        group2.add(neighbor)
                        q.append((False, neighbor))
                else:
                    group2.add(n)
                    for neighbor in edgeDict[n]:
                        if neighbor in group1:
                            continue
                        group1.add(neighbor)
                        q.append((True, neighbor))
        return True


